"id":"31405"},"source":{"id":"31235"}},"code":"console.log('call apply_style')\nconst data = source.data;\nconst SIDs = data['SID'];\nconst highlight = data['highlight'];\nconst alpha = data['alpha'];\nconst x = data['x'];\nconst y = data['y'];\nconst figure_ids = data['figure_id'];\nconst sample_ids = data['sample_id'];\nconst compositions = data['composition'];\nconst elements = data['elements'];\n\nconst length = data['highlight'].length\n\nfor (let i = 0; i &lt; length; i++) {\n    if (!!highlight[i]) {\n        console.log(highlight[i])\n        alpha[i] = highlighted_point_opacity.value\n    } else {\n        alpha[i] = point_opacity.value\n    }\n}\nsource.change.emit();\n"},"id":"31418","type":"CustomJS"},{"attributes":{"placeholder":"e.g. Sr Ru O","title":"Elements","width":200},"id":"31404","type":"TextInput"},{"attributes":{},"id":"31461","type":"AllLabels"},{"attributes":{"placeholder":"e.g. 111","title":"Sample ID","width":100},"id":"31401","type":"TextInput"},{"attributes":{"args":{"checkbox_composition":{"id":"31409"},"checkbox_formula":{"id":"31410"},"checkbox_ids":{"id":"31408"},"radio_button_elements":{"id":"31411"}},"code":"const active = checkbox_composition.active\ncheckbox_ids.active = []\ncheckbox_formula.active = []\nradio_button_elements.active = -1\ncheckbox_composition.active = active\n"},"id":"31414","type":"CustomJS"},{"attributes":{"args":{"checkbox_composition":{"id":"31409"},"checkbox_formula":{"id":"31410"},"checkbox_ids":{"id":"31408"},"radio_button_elements":{"id":"31411"}},"code":"const active = radio_button_elements.active\ncheckbox_ids.active = []\ncheckbox_composition.active = []\ncheckbox_formula.active = []\nradio_button_elements.active = active\n"},"id":"31416","type":"CustomJS"},{"attributes":{"args":{"checkbox_toggle_plots_visibility":{"id":"31407"},"plot_linear":{"id":"31269"},"plot_linear_log":{"id":"31302"},"plot_log":{"id":"31236"},"plot_log_linear":{"id":"31335"}},"code":"const active_list = checkbox_toggle_plots_visibility.active\nplot_log.visible = active_list.includes(0)\nplot_linear.visible = active_list.includes(1)\nplot_linear_log.visible = active_list.includes(2)\nplot_log_linear.visible = active_list.includes(3)"},"id":"31412","type":"CustomJS"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"31360","type":"BoxAnnotation"},{"attributes":{},"id":"31289","type":"WheelZoomTool"},{"attributes":{"ticker":null},"id":"31460","type":"LogTickFormatter"},{"attributes":{"args":{"checkbox_composition":{"id":"31409"},"checkbox_formula":{"id":"31410"},"checkbox_ids":{"id":"31408"},"highlighted_point_opacity":{"id":"31406"},"input_composition":{"id":"31402"},"input_elements":{"id":"31404"},"input_figure_id":{"id":"31400"},"input_formula":{"id":"31403"},"input_sample_id":{"id":"31401"},"input_sid":{"id":"31399"},"point_opacity":{"id":"31405"},"radio_button_elements":{"id":"31411"},"source":{"id":"31235"}},"code":"console.time('highlight_data')\nconst data = source.data;\n// \u30d7\u30ed\u30c3\u30c8\u4e0a\u306e\u70b9\u3092\u62bc\u4e0b\u3055\u308c\u305f\u5834\u5408\u306f\u5404ID\u3092\u66f4\u65b0\u3059\u308b\nif (!!source.selected.indices[0]) {\n    const index = source.selected.indices[0]\n    input_sid.value = data['SID'][index]\n    input_figure_id.value = data['figure_id'][index]\n    input_sample_id.value = data['sample_id'][index]\n    input_composition.value = data['composition'][index]\n    input_formula.value = data['formula'][index]\n    input_elements.value = data['elements'][index] //.match(/[A-Z][a-z]?/g).join(' ') || ''\n}\nconst sid = input_sid.value\nconst figure_id = input_figure_id.value\nconst sample_id = input_sample_id.value\nconst composition = input_composition.value\nconst SIDs = data['SID'];\nconst highlight = data['highlight'];\nconst alpha = data['alpha'];\nconst x = data['x'];\nconst y = data['y'];\nconst figure_ids = data['figure_id'];\nconst sample_ids = data['sample_id'];\nconst compositions = data['composition'];\nconst formulas = data['formula']\nconst elements = data['elements'];\n\n// Create new arrays for rearranged data\nconst matched_x = [];\nconst matched_y = [];\nconst matched_SID = [];\nconst matched_highlight = [];\nconst matched_alpha = [];\nconst matched_figure_id = [];\nconst matched_sample_id = [];\nconst matched_compositions = [];\nconst matched_formulas = [];\nconst matched_elements = [];\n\nconst unmatched_x = [];\nconst unmatched_y = [];\nconst unmatched_SID = [];\nconst unmatched_highlight = [];\nconst unmatched_alpha = [];\nconst unmatched_figure_id = [];\nconst unmatched_sample_id = [];\nconst unmatched_compositions = [];\nconst unmatched_formulas = [];\nconst unmatched_elements = [];\n\nfunction pushMatchedData(i) {\n    matched_x.push(x[i]);\n    matched_y.push(y[i]);\n    matched_SID.push(SIDs[i]);\n    matched_highlight.push(1);\n    matched_alpha.push(highlighted_point_opacity.value);\n    matched_figure_id.push(figure_ids[i]);\n    matched_sample_id.push(sample_ids[i]);\n    matched_compositions.push(compositions[i]);\n    matched_formulas.push(formulas[i]);\n    matched_elements.push(elements[i]);\n}\n\nfunction pushUnmatchedData(i) {\n    unmatched_x.push(x[i]);\n    unmatched_y.push(y[i]);\n    unmatched_SID.push(SIDs[i]);\n    unmatched_highlight.push(0);\n    unmatched_alpha.push(point_opacity.value);\n    unmatched_figure_id.push(figure_ids[i]);\n    unmatched_sample_id.push(sample_ids[i]);\n    unmatched_compositions.push(compositions[i]);\n    unmatched_formulas.push(formulas[i]);\n    unmatched_elements.push(elements[i]);\n}\n\nconst sidFlag = checkbox_ids.active.includes(0) ? 1 : 0;\nconst figureFlag = checkbox_ids.active.includes(1) ? 1 : 0;\nconst sampleFlag = checkbox_ids.active.includes(2) ? 1 : 0;\nconst compositionFlag = checkbox_composition.active.length === 1 ? 1 : 0 &amp;&amp; composition.length &gt; 0\nconst formulaFlag = checkbox_formula.active.length === 1 ? 1 : 0 &amp;&amp; input_formula.value.length &gt; 0\nconst elementsPartialMatchFlag = radio_button_elements.active === 0 ? 1 : 0;\nconst elementsPerfectMatchFlag = radio_button_elements.active === 1 ? 1 : 0;\n\nconst combination = sidFlag * 32 + figureFlag * 16 + sampleFlag * 8 + compositionFlag * 4 + elementsPartialMatchFlag * 2 + elementsPerfectMatchFlag * 1;\nconst length = SIDs.length;\n\n// TODO: implement formula search\nfor (var i = 0; i &lt; length; i++) {\n    var isMatched = false;\n    switch (combination) {\n        case 56: // \"111000\" \u306e\u5834\u5408\n            isMatched = sid === SIDs[i] &amp;&amp; figure_id === figure_ids[i] &amp;&amp; sample_id === sample_ids[i];\n            break;\n        case 48: // \"110000\" \u306e\u5834\u5408\n            isMatched = sid === SIDs[i] &amp;&amp; figure_id === figure_ids[i];\n            break;\n        case 40: // \"101000\" \u306e\u5834\u5408\n            isMatched = sid === SIDs[i] &amp;&amp; sample_id === sample_ids[i];\n            break;\n        case 24: // \"011000\" \u306e\u5834\u5408\n            isMatched = sample_id === sample_ids[i] &amp;&amp; figure_id === figure_ids[i];\n            break;\n        case 32: // \"100000\" \u306e\u5834\u5408\n            isMatched = sid === SIDs[i];\n            break;\n        case 16: // \"010000\" \u306e\u5834\u5408\n            isMatched = figure_id === figure_ids[i];\n            break;\n        case 8: // \"001000\" \u306e\u5834\u5408\n            isMatched = sample_id === sample_ids[i];\n            break;\n        case 4: // \"000100\" \u306e\u5834\u5408\n            isMatched = compositions[i].indexOf(composition) !== -1\n            break\n        case 2: // \"0000+10\" \u306e\u5834\u5408\n        case 1: // \"000001\" \u306e\u5834\u5408\n            // NOTE: composition\u304cpymatgen\u3067parse\u3067\u304d\u306a\u3044\u5
